import React from 'react';
import axios from 'axios';

class App extends React.Component {

	state = {
		details : [],
	}

	componentDidMount() {

		let data ;

		axios.get('http://127.0.0.1:8000/choosequiztype/')
		.then(res => {
			data = res.data;
			this.setState({
				details : data	
			});
		})
		.catch(err => {})
	}

render() {
	return(
        <div>
            <div>
                <div>
                    <h1>Quiz data will be here</h1>
                    
                </div>
            </div>
        </div>); 
}
}

export default App;
